DROP DATABASE IF EXISTS bug_tracker_aggregate;
CREATE DATABASE bug_tracker_aggregate;
USE bug_tracker_aggregate;

CREATE TABLE IF NOT EXISTS users (
  id INT AUTO_INCREMENT PRIMARY KEY,
  first_name VARCHAR(30),
  last_name VARCHAR(30),
  email VARCHAR(80) UNIQUE
) ENGINE=InnoDB;

CREATE TABLE IF NOT EXISTS tickets (
  id INT AUTO_INCREMENT PRIMARY KEY,
  title VARCHAR(128),
  project VARCHAR(64) NOT NULL,
  assignee INT,
  description TEXT,
  date_created DATETIME DEFAULT CURRENT_TIMESTAMP,
  date_updated DATETIME DEFAULT CURRENT_TIMESTAMP,
  date_completed DATETIME NULL DEFAULT NULL,
  FOREIGN KEY fk_assignee_id(assignee) REFERENCES users(id)
) ENGINE=InnoDB;

